To create a Chrome extension that takes screenshots of a webpage, you'll need to follow these steps:

1. **Create the necessary files:**
   - `manifest.json`
   - `background.js`
   - `popup.html`
   - `popup.js`
   - `content_script.js`

2. **Set up the `manifest.json` file:**
   This file describes your extension and its permissions.

```json
{
  "manifest_version": 3,
  "name": "Webpage Screenshot",
  "version": "1.0",
  "description": "Take screenshots of a webpage",
  "permissions": [
    "activeTab",
    "scripting"
  ],
  "background": {
    "service_worker": "background.js"
  },
  "action": {
    "default_popup": "popup.html",
    "default_icon": {
      "16": "images/icon16.png",
      "48": "images/icon48.png",
      "128": "images/icon128.png"
    }
  },
  "icons": {
    "16": "images/icon16.png",
    "48": "images/icon48.png",
    "128": "images/icon128.png"
  }
}
```

3. **Create the `background.js` file:**
   This file will handle the background logic of your extension.

```javascript
chrome.runtime.onInstalled.addListener(() => {
  console.log('Extension installed');
});
```

4. **Create the `popup.html` file:**
   This file will be the UI of your extension's popup.

```html
<!DOCTYPE html>
<html>
<head>
  <title>Webpage Screenshot</title>
  <style>
    body {
      width: 200px;
      font-family: Arial, sans-serif;
    }
    button {
      width: 100%;
      padding: 10px;
      margin-top: 10px;
    }
  </style>
</head>
<body>
  <h1>Webpage Screenshot</h1>
  <button id="takeScreenshot">Take Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

5. **Create the `popup.js` file:**
   This file will handle the logic for taking the screenshot when the button is clicked.

```javascript
document.getElementById('takeScreenshot').addEventListener('click', () => {
