    <div class="container mt-5">
        <table class="table table-bordered" id="sortableTable">
            <thead>
                <tr>
                    <th onclick="sortTable(0)">Name</th>
                    <th onclick="sortTable(1)">Age</th>
                    <th onclick="sortTable(2)">Country</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>John Doe</td>
                    <td>25</td>
                    <td>USA</td>
                </tr>
                <tr>
                    <td>Jane Smith</td>
                    <td>30</td>
                    <td>Canada</td>
                </tr>
                <tr>
                    <td>Alice Johnson</td>
                    <td>22</td>
                    <td>UK</td>
                </tr>
            </tbody>
        </table>
    </div>

    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>
    <script>
        function sortTable(columnIndex) {
            const table = document.getElementById('sortableTable');
            const rows = Array.from(table.rows).slice(1);
            const isNumber = rows.every(row => !isNaN(row.cells[columnIndex].innerHTML));
            const sortedRows = rows.sort((a, b) => {
                const aValue = a.cells[columnIndex].innerHTML;
                const bValue = b.cells[columnIndex].innerHTML;
                if (isNumber) {
                    return aValue - bValue;
                } else {
                    return aValue.localeCompare(bValue);
                }
            });

            // Check if the table is already sorted in the same order
            const isSorted = rows.every((row, index) => row === sortedRows[index]);

            if (isSorted) {
                sortedRows.reverse();
            }

            // Append sorted rows back to the table body
            const tbody = table.tBodies[0];
            tbody.innerHTML = '';
            sortedRows.forEach(row => tbody.appendChild(row));
        }
    </script>
</body>
</html>
```

2. **JavaScript Function**: The `sortTable` function handles the sorting logic.

- **Parameters**: The function takes `columnIndex` as a parameter, which indicates the column to sort by.
- **Table and Rows**: It retrieves the table and converts the rows into an array, excluding the header row.
- **Sorting Logic**: It checks if the column contains numeric values and sorts accordingly.
- **Reverse Sorting**: It checks if the table is already sorted in the same order and reverses the sorting if needed.
- **Appending Sorted Rows**: Finally, it appends the sorted rows back to the table body.

This approach ensures that the table can be sorted alphanumerically by clicking the headers without relying on jQuery or other plugins.

 Certainly! Compiler optimization techniques are crucial for improving the performance of code by making it more efficient. Here are a few popular compiler optimization techniques with example codes:

### 1. Loop Unrolling
Loop unrolling reduces the overhead of loop control by duplicating the loop body multiple times.

**Example:**
```c
// Original code
for (int i = 0; i < 10; i++) {
    array[i] = i * 2;
}

// Optimized code with loop unrolling
array[0] = 0 * 2;
array[1] = 1 * 2;
array[2] = 2 * 2;
array[3] = 3 * 2;
array[4] = 4 * 2;
array[5] = 5 * 2;
array[6] = 6 * 2;
array[7] = 7 * 2;
array[8] = 8 * 2;
array[9] = 9 * 2;
```

### 2. Inlining
Inlining replaces function calls with the actual function code to eliminate the overhead of function calls.

**Example:**
```c
// Original code
int add(int a, int b) {
    return a + b;
}

int main() {
    int x = 5, y = 10;
    int result = add(x, y);
    return result;
}

// Optimized code with inlining
int main() {
    int x = 5, y = 10;
    int result = x + y;
    return result;
}
```

### 3. Dead Code Elimination
Dead code elimination removes code that does not affect the program's output.

**Example:**
```c
// Original code
int main() {
    int x = 5;
    int y = 10;
    int z = x + y; // z is never used
    return x;
}

// Optimized code with dead code elimination
int main() {
    int x = 5;
    return x;
}
```

### 4. Constant Folding
Constant folding evaluates constant expressions at compile time rather than at runtime.

**Example:**
```c
// Original code
int main() {
    int x = 5;
    int y = 10;
    int z = x * y;
    return z;
}

// Optimized code with constant folding
int main() {
    int z = 50;
    return z;
}
```

